require.config({"config": {
        "text":{"Magento_Paypal/template/payment/paypal_billing_agreement-form.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"payment-method\" data-bind=\"css: {'_active': (getCode() == isChecked())}\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"attr: {'id': getCode()}, value: getCode(), checked: isChecked, click: selectPaymentMethod, visible: isRadioButtonVisible()\"/>\n        <span data-bind=\"text: getTitle()\"></span>\n    </div>\n    <div class=\"payment-method-content\">\n        <!-- ko foreach: getRegion('messages') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n        <form id=\"billing-agreement-form\">\n            <div class=\"payment-method-billing-address\">\n                <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\n                <!-- ko template: getTemplate() --><!-- /ko -->\n                <!--/ko-->\n            </div>\n            <select data-bind=\"\n                    attr: {id: getCode() + '_ba_agreement_id', name: 'payment[' + getTransportName() + ']',\n                    'data-validate': JSON.stringify({required:true})},\n                    options: getBillingAgreements(),\n                    optionsValue: 'id',\n                    optionsText: 'referenceId',\n                    optionsCaption: $t('-- Please Select Billing Agreement--'),\n                    value: selectedBillingAgreement\"\n                    class=\"select\">\n            </select>\n        </form>\n        <div class=\"checkout-agreements-block\">\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\n                <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n\n        <div class=\"actions-toolbar\" id=\"review-buttons-container\">\n            <div class=\"primary\">\n                <button class=\"action primary checkout\"\n                        type=\"submit\"\n                        data-bind=\"\n                        click: placeOrder,\n                        attr: {title: $t('Place Order')},\n                        enable: (getCode() == isChecked()),\n                        css: {disabled: !isPlaceOrderActionAllowed()}\n                        \"\n                        data-role=\"review-save\">\n                    <span data-bind=\"i18n: 'Place Order'\"></span>\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n"}
}});
